import style from './Slider.module.css';

const Slider = ({images}) => {
    return(
        <div className={style.container}>
            {images.map((imagen, index) => {
                return <img key={index} src={imagen} alt='cesar' />
            })}
        </div>
    )
}

export default Slider;
